import "./Sponsoring.scss";

class Sponsoring extends Component {
  render() {
    return (
      <Fragment>
        <div className="container">
          <h1>Send me an email ðŸ˜€</h1>
          <p>
            Reach out for a project or just to say hello! My personal email is
            benoit.rouquie@gamil.com
          </p>
          <div className="small-container">
            <label for="name" style={{ textAlign: "left", fontWeight: "bold" }}>
              Name
            </label>
            <input type="text" name="name" />
            <label for="Email Address">Email Address</label>
            <input type="email" name="name" />
            <label for="Message">Message</label>
            <textarea name="message" />
            <button
              className="button"
              style={{ display: "flex", cursor: "pointer" }}
            >
              Send
            </button>
          </div>
        </div>
      </Fragment>
    );
  }
}

export default Sponsoring;
